import React from "react";
import Timeline from "@material-ui/lab/Timeline";
import TimelineItem from "@material-ui/lab/TimelineItem";
import TimelineSeparator from "@material-ui/lab/TimelineSeparator";
import TimelineConnector from "@material-ui/lab/TimelineConnector";
import TimelineContent from "@material-ui/lab/TimelineContent";
import TimelineDot from "@material-ui/lab/TimelineDot";
import TimelineOppositeContent from "@material-ui/lab/TimelineOppositeContent";
import Typography from "@material-ui/core/Typography";
import { makeStyles } from "@material-ui/core/styles";
import Card from "@material-ui/core/Card";
import CardHeader from "@material-ui/core/CardHeader";
import CardMedia from "@material-ui/core/CardMedia";



const useStyles = makeStyles((theme) => ({
  root: {
    maxWidth: 345
  },
  media: {
    height: 0,
    paddingTop: "56.25%" // 16:9
  },
}));

export default function Experiences() {
  const classes = useStyles();


  return (
    <React.Fragment>
      <Timeline align="alternate">
        <TimelineItem>
        <Card className={classes.root}>
      <CardHeader
        title="Shrimp and Chorizo Paella"
        subheader="September 14, 2016"
      />
      <CardMedia
        className={classes.media}
        image="/static/images/cards/paella.jpg"
        title="Paella dish"
      />
    </Card>

        </TimelineItem>







        <br></br>
        <br></br>
        <TimelineItem>
          <TimelineOppositeContent>
            <Typography color="textSecondary">2019-present</Typography>
          </TimelineOppositeContent>
          <TimelineSeparator>
            <TimelineDot color="teal" />
            <TimelineConnector />
          </TimelineSeparator>
          <TimelineContent>
          <Card className={classes.root}>
      <CardHeader
        title="Shrimp and Chorizo Paella"
        subheader="September 14, 2016"
      />
      <CardMedia
        className={classes.media}
        image="/static/images/cards/paella.jpg"
        title="Paella dish"
      />
    </Card>
          </TimelineContent>
        </TimelineItem>
        <br></br>
        <br></br>








        <TimelineItem>
          <TimelineOppositeContent>
            <Typography color="textSecondary">2015-2019</Typography>
          </TimelineOppositeContent>
          <TimelineSeparator>
            <TimelineDot color="teal" />
            <TimelineConnector />
          </TimelineSeparator>
          <TimelineContent>
            <Typography variant="h4">
              The "Vladimir Streinu" High School - Găești
            </Typography>
            <Typography variant="h7">
              Mathematics - Informatics - Bilingual English
            </Typography>
            <br></br>
          </TimelineContent>
        </TimelineItem>
      </Timeline>
    </React.Fragment>
  );
}
